$button-height-lg: 56px;
$button-height-md: 48px;
$button-height-sm: 40px;

@mixin button-base() {
    @include disabled();
    @include appearance-reset();
    text-align: left;
    position: relative;
    text-decoration: none;
    vertical-align: middle;
    font-weight: $font-weight-regular;
    color: $color-text-primary-onlight;

    background-color: transparent;

    cursor: pointer;
    display: inline-flex;
    align-items: center;

    &:active {
        opacity: 0.5;
    }
}

@mixin button--sm() {
    @include type-paragraph-sm();
    height: $button-height-sm;
    min-width: $button-height-sm;

    &.button--circle {
        padding: 0;
        width: $button-height-sm;

        .icon {
            @include icon-size($icon-size-sm);
        }
    }

    &.button--rounded {
        border-radius: $button-height-sm / 2;
    }

    .button__icon {
        width: $icon-size-xs;
        height: $icon-size-xs;

        .icon {
            @include icon-size($icon-size-xs);
        }
    }

    .button__icon:first-child {
        margin-right: -$icon-size-xs;

        .icon:first-child {
            margin-left: -$icon-size-xs;
        }
    }

    &.button--underline--simple .button__icon:first-child {
        margin-right: 16px;
    }
}

@mixin button--md() {
    @include type-paragraph-md();
    height: $button-height-md;
    min-width: $button-height-md;

    &.button--circle {
        padding: 0;
        width: $button-height-md;

        .icon {
            @include icon-size($icon-size-md);
        }
    }

    &.button--rounded {
        border-radius: $button-height-md / 2;
    }

    .button__icon {
        width: $icon-size-sm;
        height: $icon-size-sm;

        .icon {
            @include icon-size($icon-size-sm);
        }
    }

    .button__icon:first-child {
        margin-right: -$icon-size-sm;

        .icon:first-child {
            margin-left: -$icon-size-sm;
        }
    }

    &.button--underline--simple .button__icon:first-child {
        margin-right: 16px;
    }
}

@mixin button--lg() {
    @include type-paragraph-lg();
    height: $button-height-lg;
    min-width: $button-height-lg;

    &.button--circle {
        padding: 0;
        width: $button-height-lg;

        .icon {
            @include icon-size($icon-size-lg);
        }
    }

    &.button--rounded {
        border-radius: $button-height-lg / 2;
    }

    &.button--underline {
        .button__icon {
            width: $icon-size-md;
            height: $icon-size-md;

            .icon {
                @include icon-size($icon-size-md);
            }
        }

        .button__icon:first-child {
            margin-right: -$icon-size-md;

            .icon:first-child {
                margin-left: -$icon-size-md;
            }
        }

        &.button--underline--simple .button__icon:first-child {
            margin-right: 16px;
        }
    }
}

@mixin button--underline() {
    .button__icon {
        overflow: hidden;
        display: inline-flex;

        .icon {
            transition: $transition-ui-default;
            position: relative;
        }
    }

    .button__icon:last-child {
        margin-left: 32px;
    }

    .button__label {
        transition: $transition-ui-default;
        display: block;
    }

    &:hover,
    &:focus {
        .icon {
            transform: translateX(100%);
        }
        .button__label {
            transform: translateX(40px);
        }
    }

    &.button--underline--simple {
        &:hover,
        &:focus {
            .button__label {
                transform: none;
                margin-left: 12px;
            }
        }
    }
}

@mixin button--solid($color-text, $color-fill) {
    color: $color-text;
    background-color: $color-fill;

    &:hover,
    &:focus {
        border: 1px solid transparent;
        background-color: darken($color-fill, 10%);
    }

    &:active {
        opacity: 1;
        background-color: darken($color-fill, 15%);
    }
}

.button {
    @include button-base();
    @include button--md();
}

.button--sm {
    @include button--sm();
}

.button--md {
    @include button--md();
}

.button--lg {
    @include button--lg();
}

.button--underline {
    @include ui-underline();
    @include button--underline();
}

.button--circle {
    align-items: center;
    justify-content: center;
    border-radius: 50%;
    position: relative;

    &::before {
        content: "";
        top: 0;
        left: 0;
        opacity: 0;
        width: 100%;
        height: 100%;
        border-radius: 50%;
        position: absolute;
        background-color: currentColor;
    }

    &:hover,
    &:focus {
        &::before {
            opacity: 0.08;
        }
    }

    @media (hover: hover) {
        &:hover {
            .button__label {
                opacity: 1;
                visibility: visible;
                transform: translate3d(-50%, 0, 0);
                transition: $transition-ui-default;
            }
        }
    }

    &:active {
        opacity: 1;
        transform: translateY(1px);

        &::before {
            opacity: 0.15;
        }
    }

    .button__label {
        @include type-paragraph-sm();
        top: 100%;
        left: 50%;
        opacity: 0;
        display: block;
        margin: 4px auto 0;
        padding: 4px 10px;
        visibility: hidden;
        position: absolute;
        text-align: center;
        white-space: nowrap;
        transform: translate3d(-50%, -25%, 0);
        color: $color-text-base-ondark;
        box-shadow: $box-shadow-overlay;
        border-radius: $border-radius-sm;
        transition: $transition-ui-default;
        transition-duration: 0.1s;
        background-color: $color-fill-gray-darker;
    }
}

.button--rounded {
    text-align: center;
    padding-left: 1.5em;
    padding-right: 1.5em;
    border-radius: 50%;
    border: 1px dotted currentColor;
    overflow: hidden;
    position: relative;

    &:hover,
    &:focus {
        border: 1px solid currentColor;
    }

    &:active {
        transform: translateY(1px);
    }
}

.button--solid {
    border: 1px solid transparent;
    @include button--solid($color-text-base-ondark, $color-fill-primary);

    &.button--secondary {
        @include button--solid(
            $color-text-base-onlight,
            $color-fill-gray-light
        );
    }
    &.button--alert {
        @include button--solid(
            $color-text-base-ondark,
            $color-fill-accent-orange
        );
    }
}

.button--secondary {
    color: $color-text-base-onlight;
}

.button--accent-orange {
    color: $color-text-accent-orange-onlight;
}

.dark {
    .button {
        color: $color-text-primary-ondark;
    }

    .button--secondary {
        color: $color-text-base-ondark;
    }

    .button--accent-orange {
        color: $color-text-accent-orange-ondark;
    }

    .button--solid {
        @include button--solid($color-text-base-ondark, $color-fill-primary);

        &.button--secondary {
            @include button--solid(
                $color-text-base-ondark,
                $color-fill-white-alpha-10
            );
        }
        &.button--alert {
            @include button--solid(
                $color-text-base-onlight,
                $color-fill-accent-orange
            );
        }
    }
}

