sources.src/scss/components/_link.scss:
@mixin link-base() {
    color: $color-text-primary-onlight;
    text-decoration: none;

    &:hover,
    &:focus {
        text-decoration: underline;
    }

    &:active {
        opacity: 0.75;
    }

    .dark &,
    .dark-header & {
        color: $color-text-primary-ondark;
    }
}

@mixin link-underline() {
    display: inline-block;
    position: relative;

    &::before,
    &::after {
        left: 0;
        bottom: 0;
        width: 100%;
        height: 0.1rem;
        position: absolute;
        content: "";
    }

    &::before {
        border-top: 1px dotted currentColor;
        opacity: 0.5;
    }

    &::after {
        transform: scaleX(0);
        transform-origin: right center;
        border-top: 1px solid currentColor;
        transition: transform 0.35s ease;
    }

    &:hover,
    &:focus {
        outline: none;
        text-decoration: none;

        &::after {
            transform: scaleX(1);
            transform-origin: left center;
        }
    }

    &:active {
        transition: none;
        opacity: 0.75;
    }
}

.link {
    @include link-base();

    &[disabled] {
        cursor: pointer;
        pointer-events: none;
    }
}

.link-underline {
    color: inherit;
    @include link-underline();
}

